('crm',1,'page_Proposals Inbox_header_en_US','page_Proposals Inbox_header','en_US','<h2>Proposals Inbox</h2>\n<br/>\n<p><b>Tips to Joget administrator:</b></p>\n<ul>\n<li>Input your Joget SMTP server configurations in <a href=\"/jw/web/console/setting/general\">Web Console &gt; General Settings</a> to send email messages.</li>\n<li>Input an email address for admin user in <a href=\"/jw/web/console/directory/users\">Web Console &gt; Setup Users</a> for email notification to work.</li>\n</ul>\n<p></p>'),
