('isr',1,'page_about_richText2_en_US','page_about_richText2','en_US',' app has been built especially for Joget DX Enterprise/Professional.\n</p>\n<p>This app uses&nbsp;many of the new features and capabilities of Joget DX in forms, datalist and userview.\n</p>\n<p>&nbsp;\n</p>\n<p>\n  <strong>Welcome to the Customer Relationship Management App\n  </strong>\n</p>\n<p>More Leads, More Sales, More Customers\n</p>\n<p>Use the free CRM app in your business to:\n</p>\n<ul>\n  <li>Track your prospects and customers,\n  </li>\n  <li>Track sales opportunities, and\n  </li>\n  <li>Submit sales proposals for approval.\n  </li>\n  <li>\n</li>\n</ul>\n<p>\n  <strong>Tips to Joget administrator:\n  </strong>\n</p>\n<ul>\n  <li>Input your Joget SMTP server configurations in \n    <a href=\"/jw/web/console/setting/general\" target=\"_blank\">Web Console &gt; General Settings\n    </a> to send email messages.\n  </li>\n  <li>Input an email address for admin &amp; other users in \n    <a href=\"/jw/web/console/directory/users\" target=\"_blank\">Web Console &gt; Setup Users\n    </a> for email notification to work.\n  </li>\n</ul>'),
('isr',1,'page_about_richText2_zh_CN','page_about_richText2','zh_CN',' appJoget DX Enterprise/Professional\n</p>\n<p>Joget DX\n</p>\n<p>&nbsp;\n</p>\n<p>\n  <strong>App\n  </strong>\n</p>\n<p>(ISR)\n</p>\n<p>(HOD)ISR\n</p>\n<p>\n  <strong>Joget:\n  </strong>\n</p>\n<ul>\n  <li> \n    <a href=\"/jw/web/userview/expenseclaim/home/_/setupCategory\" target=\"_blank\">\n    </a> (:)\n  </li>\n  <li> <a href=\"/jw/web/console/setting/general\" target=\"_blank\"> &gt; \n    </a> Joget SMTP\n  </li>\n  <li> <a href=\"/jw/web/console/directory/users\" target=\"_blank\"> &gt; \n    </a> \n  </li>\n</ul>'),
