('JogetDxShowcase',1,'Chart Document List_en_US','Chart Document List','en_US','The following are features of Joget Charts:\n\nUses SQL query commands to retrieve and populate the chart.\nYou can define the height, width and color of the rendered chart.\nIf you choose bar chart, you can specify to render in horizontal or vertical orientation.\nIn additional, bar charts allow you to display stack elements.\nAll charts allow you to key in additional text above and below the chart. This app used the bottom footer to provide additional description about the chart.\nFinally, you decide the source of the data (Datasource) or database to \'pull\' your data from. It can be an external database outside of Joget.'),
('JogetDxShowcase',1,'Chart Document List_zh_CN','Chart Document List','zh_CN','The following are features of Joget Charts:\n\nUses SQL query commands to retrieve and populate the chart.\nYou can define the height, width and color of the rendered chart.\nIf you choose bar chart, you can specify to render in horizontal or vertical orientation.\nIn additional, bar charts allow you to display stack elements.\nAll charts allow you to key in additional text above and below the chart. This app used the bottom footer to provide additional description about the chart.\nFinally, you decide the source of the data (Datasource) or database to \'pull\' your data from. It can be an external database outside of Joget.'),
