('expenseclaim',1,'home','Expenses Claim',NULL,'{\n\"categories\": [\n{\n\"className\": \"org.joget.apps.userview.model.UserviewCategory\",\n\"menus\": [{\n\"className\": \"org.joget.apps.userview.lib.HtmlPage\",\n\"properties\": {\n\"content\": \"<h1><\\/h1>\\n<table width=\\\"90%\\\" border=\\\"0\\\" collapse=\\\"\\\" align=\\\"center\\\">\\n<tbody>\\n<tr>\\n<td>\\n<h1><span style=\\\"font-size: 36pt; color: #333333;\\\">Welcome to Expenses Claim App<\\/span><\\/h1>\\n<p><span style=\\\"font-size: 14pt; color: #000000;\\\"> Track, Review and Manage Employee Expenses Claims <\\/span><\\/p>\\n<\\/td>\\n<\\/tr>\\n<tr>\\n<td><img width=\\\"100%\\\" src=\\\"#appResource.expenses-tightcrop.jpg#\\\"><\\/td>\\n<\\/tr>\\n<tr>\\n<td><br>\\n<p>The Expenses Claim app allows employees to submit their expenses claims for reimbursements. The respective Head of Departments (HOD) will be able to review, track and approve all employee expenses claims before final reimbursements by the Finance Department.<\\/p>\\n<p><span style=\\\"color: #333333;\\\"><strong>Workflow Approval Cycle:<\\/strong><\\/span><\\/p>\\n<ol>\\n<li>The claimant submits a New Expenses Claim.<\\/li>\\n<li>Expense claim is routed to the selected HOD for approval.<\\/li>\\n<li>If approved, the expense claim is routed to the Finance Department for verification and processing of payment.<\\/li>\\n<li>This app defaults the Finance Department approver to the \\\"admin\\\" user, which you can change in the \\\"Map Participants to Users\\\" screen.<\\/li>\\n<li>HOD can request the claimant to resubmit the expense claim and the expense claim will redirected back to the claimant\'s inbox for evaluation, or the HOD can reject it, which will end the process flow.<\\/li>\\n<\\/ol>\\n<p><span style=\\\"color: #333333;\\\">This Expenses Claim app has been built to make use of the new features and capababilities of Joget DX Enterprise or Professional Edition.<\\/span><\\/p>\\n<p><span style=\\\"color: #333333;\\\"><strong>Before using this app, perform the following steps: (Need admin role permission)<\\/strong><\\/span><\\/p>\\n<ol>\\n<li>Set up the <a href=\\\"/jw/web/userview/expenseclaim/home/_/setupCategory\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Claim Categories <\\/a> (Example: Entertainment, Medical, Mileage and Toll, etc.).<\\/li>\\n<li>Input your Joget DX SMTP server configurations in&nbsp; <a href=\\\"/jw/web/console/setting/general\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Web Console &gt; General Settings <\\/a>&nbsp;to send email messages.<\\/li>\\n<li>Input an email address for admin user in&nbsp; <a href=\\\"/jw/web/console/directory/users\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Web Console &gt; Setup Users <\\/a>&nbsp;for email notification to work.<\\/li>\\n<\\/ol>\\n<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\",\n\"customId\": \"home\",\n\"enableOffline\": \"\",\n\"id\": \"BE8152B27C024938A3AA82BA91B7783B\",\n\"label\": \"<i class=\\\"fa fa-home\\\" aria-hidden=\\\"true\\\"><\\/i> Welcome\",\n\"userviewCacheDuration\": \"10\",\n\"userviewCacheScope\": \"application\"\n}\n}],\n\"properties\": {\n\"hide\": \"\",\n\"id\": \"category-3518F9804D014AA0BD36B017E6B34A53\",\n\"label\": \"Main\",\n\"permission\": {\n\"className\": \"org.joget.plugin.enterprise.AnonymousUserviewPermission\",\n\"properties\": {}\n}\n}\n},\n{\n\"className\": \"org.joget.apps.userview.model.UserviewCategory\",\n\"menus\": [{\n\"className\": \"org.joget.plugin.enterprise.DashboardMenu\",\n\"properties\": {\n\"autoHeight\": \"true\",\n\"customFooter\": \"\",\n\"customHeader\": \"<h2 style=\\\"font-size:20px; width: 300px; padding: 5px; background-color: #00000061 !important; color: white !important; margin-left: -40px !important;\\\">&nbsp;&nbsp;&nbsp;#i18n.Expenses Claims Dashboard#<\\/h2>\\n<style>\\n.breadcrumb {\\n    display: block;\\n    text-align: right;\\n    margin-bottom: 15px;\\n    background-color: #ffffffba !important;\\n    font-size: 90%;\\n    margin-left: auto;\\n    width: fit-content;\\n    padding: 3px !important;\\n}\\na.reset_position {\\n    color: white !important;\\n    background-color: #00000057;\\n    width: 165px;\\n    padding: 5px;\\n    margin-left: auto;\\n}\\n#page:before  {\\n  background-image: url(\\\"#appResource.desktop.jpg#\\\");\\n  background-repeat: no-repeat, repeat;\\n  background-size: cover;\\n  content: \\\"\\\";\\n  position: fixed;\\n  top: 0;\\n  left: 0;\\n  right: 0;\\n  bottom: 0;\\n}\\n<\\/style>\",\n\"customId\": \"da\",\n\"customPortletSetting\": [],\n\"defaultPortletHeight\": \"250\",\n\"defaultPortletWidth\": \"1\",\n\"enableOffline\": \"\",\n\"id\": \"D7AC42CBC83548ABB13C84C4BC7BE611\",\n\"label\": \"<i class=\\\"fa fa-tachometer\\\" aria-hidden=\\\"true\\\"><\\/i> Dashboard\",\n\"mode\": \"plugins\",\n\"plugins\": [\n{\n\"autoHeight\": \"true\",\n\"autoReload\": \"\",\n\"fixed\": \"\",\n\"height\": \"\",\n\"resizable\": \"true\",\n\"userviewMenu\": {\n\"className\": \"org.joget.plugin.enterprise.DataListInboxMenu\",\n\"properties\": {\n\"appFilter\": \"process\",\n\"assignment-customFooter\": \"\",\n\"assignment-customHeader\": \"\",\n\"customId\": \"\",\n\"datalistId\": \"ExpenseClaimDInbox\",\n\"id\": \"\",\n\"keyName\": \"\",\n\"label\": \"My Inbox\",\n\"list-customFooter\": \"\",\n\"list-customHeader\": \"\",\n\"processId\": \"process1\",\n\"rowCount\": \"\",\n\"showDetail\": \"\",\n\"showPopup\": \"\"\n}\n},\n\"width\": \"2\",\n\"x\": \"\",\n\"y\": \"\"\n},\n{\n\"autoHeight\": \"true\",\n\"autoReload\": \"\",\n\"fixed\": \"\",\n\"height\": \"\",\n\"resizable\": \"true\",\n\"userviewMenu\": {\n\"className\": \"org.joget.plugin.enterprise.SqlChartMenu\",\n\"properties\": {\n\"categoryAxisLabel\": \"Month\",\n\"chartHeight\": \"100%\",\n\"chartType\": \"bar\",\n\"chartUseAllDataRows\": \"\",\n\"chartWidth\": \"100%\",\n\"customFooter\": \"\",\n\"customHeader\": \"\",\n\"customId\": \"\",\n\"datalistId\": \"ExpensesByMonths\",\n\"datasource\": \"datalist\",\n\"horizontal\": \"\",\